import React, { Component } from "react";
import Fade from "react-slideshow-image/lib/components/slideshow/fade";
import lehigh1 from "../images/lehigh-1.png";
import lehigh2 from "../images/lehigh-3.png";
import lehigh3 from "../images/lehigh-4.png";
import lehigh4 from "../images/lehigh-5.png";

const slides = [lehigh1, lehigh2, lehigh3, lehigh4];

const properties = {
  duration: 5000,
  transitionDuration: 2000,
  infinite: true,
  indicators: true,
  arrows: true,
  onChange: (oldIndex, newIndex) => {
    console.log(`slide transition from ${oldIndex} to ${newIndex}`);
  }
};

class Education extends Component {
  state = {};

  render() {
    return (
      <div className="education">
        <div className="slide-container">
          <Fade {...properties}>
            slides.map(slide =>
            {
              <div className="each-fade">
                <div>
                  <img
                    className="lehigh-photo"
                    src={fadeImages[0]}
                    alt="Lehigh University 1"
                  />
                </div>
              </div>
            }
            )
            <div className="each-fade">
              <div>
                <img
                  className="lehigh-photo"
                  src={fadeImages[0]}
                  alt="Lehigh University 1"
                />
              </div>
            </div>
            <div className="each-fade">
              <div>
                <img
                  className="lehigh-photo"
                  src={fadeImages[1]}
                  alt="Lehigh University 2"
                />
              </div>
            </div>
          </Fade>
        </div>
        <div className="lehigh-text-container">
          <h3 className="lehigh-name">LEHIGH UNIVSERSITY</h3>
          <h3 className="lehigh-address">Bethlehem, Pennsylvania</h3>
          <br />
          <p className="lehigh-degree">
            2006 - 2010 | Bachelor of Science; <b>Finance</b>
          </p>
          <p className="lehigh-minor">
            <i>Minor in Psychology and Sociology</i>
          </p>
        </div>
      </div>
    );
  }
}

export default Education;
